import { Forum } from "./Forum.ts";
type ForumItemProps = {
    forum: Forum;
}

export const ForumItem = (props: ForumItemProps) => {
    const { forum } = props;
    return (
        <tr>
            <td>{forum.Id}</td>
            <td>{forum.Zdjecie}</td>
            <td>{forum.Nazwa}</td>
            <td>{forum.Wpis}</td>
        </tr>
    )
}
